		{
			TimeSpan timeSpan = fecha_fin - DateTime.Now;
			if (timeSpan.TotalMinutes < 0.0)
			{
				return "Caducó";
			}
			if (timeSpan.Days == 0)
			{
				return "Caduca Hoy";
			}
			if (timeSpan.Days == 1)
			{
				return "1 día";
			}
			return $"{timeSpan.Days} días";
		}
