		public decimal cant_vta()
		{
			return cantidad;
		}

		public decimal subTotal()
		{
			return precio_vta * cant_vta() / (1.0m + articulo.iva);
		}

		public decimal descuento()
		{
			return subTotal() * porcent_desc;
		}

		public decimal subTotalConDescuento()
		{
			return subTotal() - descuento();
		}

		public decimal getIVA()
		{
			return (subTotal() - descuento()) * articulo.iva;
		}

		public decimal getIVAd3()
		{
			return Math.Ceiling(decimal.Parse(getIVA().ToString("F4")) * 1000.0m) / 1000.0m;
		}

		public decimal total()
		{
			return subTotal() + getIVA() - descuento();
		}

		public decimal subTotalUnitario()
		{
			return precio_vta / (1.0m + articulo.iva);
		}

		public decimal descuentoUnitario()
		{
			return subTotalUnitario() * porcent_desc;
		}

		public decimal subTotalUnitarioConDescuento()
		{
			return subTotalUnitario() - descuentoUnitario();
		}

		public decimal IVAUnitario()
		{
			return (subTotalUnitario() - descuentoUnitario()) * articulo.iva;
		}

		public decimal totalUnitario()
		{
			return subTotalUnitario() + IVAUnitario() - descuentoUnitario();
